import React from "react";
import "./App.css";
import Header from "./Header";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Header />
        <Switch>
          <Route path="/chat">
            <h1> I am chat page</h1>
          </Route>
          <Route path="/">
            <h1> I am homepage</h1>
            <h1>:fire</h1>
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
